import { Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/">
          <h1>Main page</h1>
        </Route>
        <Route Link="/about">
          <h1>About us</h1>
        </Route>
        <Route path="/contacts">
          <h1>Contact us</h1>
        </Route>
      </Routes>
    </div>
  );
}

export default App;
